/*Table structure for table `billing` */

DROP TABLE IF EXISTS `billing`;

CREATE TABLE `billing` (
  `billTransID` bigint(20) NOT NULL AUTO_INCREMENT,
  `bookingID` varchar(20) DEFAULT NULL,
  `guestID` int(11) DEFAULT NULL,
  `billDate` date DEFAULT NULL,
  `feeTitle` varchar(100) DEFAULT NULL,
  `amount` double DEFAULT NULL,
  `feeType` varchar(10) DEFAULT 'ROOM',
  `status` varchar(10) DEFAULT 'OK',
  `lastUser` varchar(100) DEFAULT 'NONE',
  PRIMARY KEY (`billTransID`)
) ENGINE=InnoDB AUTO_INCREMENT=746 DEFAULT CHARSET=latin1;

