  `receptionist` varchar(100) DEFAULT 'NONE',
  `commission` double DEFAULT '0',
  PRIMARY KEY (`transID`)
) ENGINE=InnoDB AUTO_INCREMENT=274 DEFAULT CHARSET=latin1;

