/*Table structure for table `booking_temporary` */

DROP TABLE IF EXISTS `booking_temporary`;

CREATE TABLE `booking_temporary` (
  `transID` bigint(20) NOT NULL AUTO_INCREMENT,
  `reservationSource` varchar(20) DEFAULT 'WALK-IN',
  `bookingID` varchar(20) DEFAULT NULL,
  `guestID` int(11) DEFAULT NULL,
  `roomID` int(11) DEFAULT NULL,
  `dateIn` date DEFAULT NULL,
  `dateOut` date DEFAULT NULL,
  `season` varchar(20) DEFAULT 'PEAK',
  `rate` double DEFAULT NULL,
  `pax` int(11) DEFAULT '1',
  `discountType` varchar(20) DEFAULT 'NONE',
  `discount` double DEFAULT NULL,
  `notes` varchar(200) DEFAULT 'NONE',
  `bookingDate` date DEFAULT NULL,
  `senior` int(11) DEFAULT '0',
  PRIMARY KEY (`transID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `booking_temporary` */

/*Table structure for table `employee` */

DROP TABLE IF EXISTS `employee`;

CREATE TABLE `employee` (
  `eid` int(11) NOT NULL AUTO_INCREMENT,
  `empNo` varchar(10) NOT NULL DEFAULT 'NONE',
  `lname` varchar(80) NOT NULL,
  `fname` varchar(80) NOT NULL,
  `mname` varchar(80) NOT NULL,
  `ename` varbinary(100) DEFAULT NULL,
  `designation` varchar(100) NOT NULL,
  PRIMARY KEY (`eid`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

