/*Table structure for table `other_charges` */

DROP TABLE IF EXISTS `other_charges`;

CREATE TABLE `other_charges` (
  `chargeID` bigint(20) NOT NULL AUTO_INCREMENT,
  `particular` varchar(100) DEFAULT NULL,
  `amount` double DEFAULT NULL,
  PRIMARY KEY (`chargeID`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

/*Data for the table `other_charges` */

